import React from "react";
import axios from "axios";
import { Link } from "react-router-dom";
const Products = async() =>{
    const result = await axios.get(
        "https://fakestoreapi.com/products"
     ).then((res)=>{
       console.log(res);    
     })
    return(
        <div>
            {result}
            <Link to="/"></Link>    
        </div>
    )
} 

export default Products;
